import Span from "../../atoms/Span";
import P from "../../atoms/P";

const SingleComment = ({}) => {
  return (
    <Box>
      <Box flexAttr={[0, 0, 36]} width="auto">
        <Profile width="36px" />
      </Box>
      <Box sort={BoxSort.TOP_SPACE_BETWEEN}>
        <Box width="auto">
          <Span>호호호잼누쿤</Span>
          <Span>16분전</Span>
        </Box>
        <Box width="auto">
          <Span>답글 쓰기</Span>
        </Box>
      </Box>
    </Box>
  );
};

export default SingleComment;
